import React, { useState, useEffect } from 'react'
import axios from 'axios'

const Profile = () => {
  const [user, setUser] = useState([])

  useEffect(() => {
    axios.get('/').then((res) => {
      setUser(res.data)
    })
  }, [])

  return (
    <div>
      <h1 key={user.id}>{user.name}</h1>
    </div>
  )
}

export default Profile
